            if(window.bar != undefined) 
            window.bar.destroy(); 
            window.bar = new Chart(ctxLine,{
                type: 'bar',
                data: {
                    labels: me.nombreI,
                    datasets: [{
                        label: "Pilares",
                        fontSize:10,
                        fontColor:'#666',
                        data: me.escala ,
